#C Function to attempt decryption with each key
def try_decrypt(keys, iv, encrypted_data):
    for index, key in enumerate(keys):
        backend = default_backend()
        key = bytearray(key)

        try:
            cipher = Cipher(
                algorithms.AES(key), modes.GCM(iv, auth_tag), backend=backend
            )
            decryptor = cipher.decryptor()
            decryptor.authenticate_additional_data(b"")
            decrypted_data = decryptor.update(encrypted_data) + decryptor.finalize()
            print(f"Decryption successful with key {index}: {decrypted_data.decode()}")
            return
        except Exception as e:
            print(f"Decryption failed with key {index}. Error: {e}")


# Attempt decryption with each key
try_decrypt(keys, iv, encrypted_data)
